snippet.description:
Você sabia que a ordem dos livros do Antigo Testamento nas Bíblias Cristãs não é original? Assim como todos os anciões judaicos, Jesus encontrou as Escrituras como uma coleção de pergaminhos em três partes conhecidas como a Torá, os Profetas, e os Escritos, ou TaNaK. Neste vídeo vamos explorar porque isso é importante, e o que acontece quando você lê as Escrituras na ordem tradicional Judaica.
@BibleProject - Português 

#LeiaasEscrituras #Biblia #bibleprojectportugues
